@Override
public int fillBytesRef() {
  BytesRef bytes = getBytesRef();
  bytes.bytes = collator.getCollationKey(toString()).toByteArray();
  bytes.offset = 0;
  bytes.length = bytes.bytes.length;
  return bytes.hashCode();
}

